import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

import Row from "react-bootstrap/Row";
import Figure from "react-bootstrap/Figure";
import FigureImage from "react-bootstrap/FigureImage";
import FigureCaption from "react-bootstrap/FigureCaption";
import { Data } from "@react-google-maps/api";


function Home({ restSearchData, typing }) {
  const [data, setData] = useState([]);
  const [rest, setRest] = useState([]);

  useEffect(() => {
    axios.get(`http://localhost:5000/restaurant/`).then((res) => {
      setData(res.data);
      setRest(res.data);
    });
  }, []);

  return (
    <div>
      {rest.name}
      {typing ? (
        <div>
          <Row>
            {restSearchData.map((data, id) => (
              <div key={id} className="col-lg-3 col-sm-6">
                <Figure>
                  {data.image?.length > 0 &&
                    <FigureImage
                      width={171}
                      height={180}
                      alt="171x180"
                      src={data?.image[0]}
                      style={{ width: "20rem" }} />}

                  <FigureCaption>
                    {data.name}
                    <br />
                    {data.location}
                    <br />
                    <Link to={`/Restaurants/${data._id}`}>View more</Link>
                  </FigureCaption>

                </Figure>
              </div>
            ))}
          </Row>
        </div>

      ) : (
        <div>
          <Row>
            {restSearchData.map(
              (data, id) =>
                 (
                  <div key={id} className="col-lg-3 col-sm-6">
                    <Figure>
                      <Link to={`/Restaurants/${data._id}`}>
                        {data.image?.length > 0 &&
                          <FigureImage
                            width={171}
                            height={180}
                            alt="171x180"
                            src={data?.image[0]}
                            style={{ width: "20rem" }} />}
                      </Link>

                      <FigureCaption>
                        {data.name}
                        <br />
                        {data.location}
                        {data.hours}
                        <br />
                        <Link to={`/Restaurants/${data._id}`}>View more</Link>
                      </FigureCaption>
                    </Figure>
                  </div>
                )
            )}
          </Row>
        </div>
      )}
    </div>
  );
}

export default Home;
